import React from "react";
import './CardItem.css'

const CardItem = (props) =>{
    return(
        <div className='card-item-container'>
            <h2 className='card-item-title'>{props.title}</h2>
            <img src={props.photosrc} alt={props.description}/>
            <p>{props.children}</p>
        </div>
    );
}

export default CardItem;
